    display: flex;
    justify-content: flex-start;
    align-items: center;
    width: 100%;
    height: 100%;
  }
`;

const CatagoryLogo = styled.img`
  height: 100%;
`;

export const CategoryTag = () => {
  return (
    <StyledCard>
      <CatagoryLogo src="/assets/logo-without-text.png" alt="logo" />
      <p>เหล็ก</p>
    </StyledCard>
  );
};
